import { Fragment } from 'react';
import './App.css';
import  {BrowserRouter as Router , Switch,Route,Redirect} from "react-router-dom"
import Dashboard from "./components/Login__Registration/Dashboard/Dashboard"
import Login from './components/Login__Registration/Login';
import Registration from './components/Login__Registration/Registration';

function App() {
  return (
    <Fragment>
      <Router>
        <div className="container">
          <Switch>
              <Route exact path="/login" render={props => <Login  {...props}/>}  />
              <Route exact path="/register" render={props => <Dashboard  {...props}/>}  />
              <Route exact path="/dashboard" render={props => <Login  {...props}/>}  />
          </Switch>
        </div>
      </Router>
      <Dashboard />
      <Login />
      <Registration />
    </Fragment>
  );
}

export default App;
